import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Navbar = ({ user, onLogout }) => {
  const location = useLocation();

  return (
    <nav className="navbar">
      <Link to="/" className="logo">
        nebula.ai
      </Link>

      <div className="nav-links">
        {user ? (
          <>
            <Link to="/dashboard" className={`nav-btn ${location.pathname === '/dashboard' ? 'active' : ''}`}>
              Dashboard
            </Link>
            <Link to="/generator" className={`nav-btn ${location.pathname === '/generator' ? 'active' : ''}`}>
              Create Campaign
            </Link>
            <Link to="/history" className={`nav-btn ${location.pathname === '/history' ? 'active' : ''}`}>
              History
            </Link>
            <span className="nav-btn">Hi, {user.name}</span>
            <button onClick={onLogout} className="nav-btn">
              Logout
            </button>
          </>
        ) : (
          <>
            <Link to="/login" className="nav-btn">
              Login
            </Link>
            <Link to="/register" className="nav-btn primary">
              Get Started
            </Link>
          </>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
